import React, { useEffect, useState } from "react";
import API from "../../utils/API";


function DataArea() {

    const [users, setUsers] = useState([]);

    useEffect(() => {
        API.getUsers()
      .then(res => {
        console.log(res.data)
        setUsers(res.data)
      })
      .catch(err => console.log(err));
      }, []);


    return (
        <div>
            <ul>
            {users.map(user => {
                <li>{user.result}</li>
            })}
            </ul>
        </div>
    )
}

export default DataArea;
